(4, 'ralphguzz123@gmail.com', 'ali.gguzz@gmail.com', 'New test email with numerous attachments is going to be tested', 'Here\'s the text content', '<p><span style=\"color: rgb(86, 156, 214);\">public</span> <span style=\"color: rgb(86, 156, 214);\">function</span> <span style=\"color: rgb(220, 220, 170);\">getmails</span>(<span style=\"color: rgb(78, 201, 176);\">Request</span> <span style=\"color: rgb(156, 220, 254);\">$request</span>)</p><p>    {</p><p>        <span style=\"color: rgb(156, 220, 254);\">$data</span> = <span style=\"color: rgb(220, 220, 170);\">array</span>();</p><p>        <span style=\"color: rgb(197, 134, 192);\">try</span> {</p><p>            <span style=\"color: rgb(156, 220, 254);\">$data</span> = <span style=\"color: rgb(156, 220, 254);\">$request</span>-&gt;<span style=\"color: rgb(220, 220, 170);\">all</span>();            </p><p>            <span style=\"color: rgb(197, 134, 192);\">if</span>(<span style=\"color: rgb(156, 220, 254);\">$data</span>[<span style=\"color: rgb(206, 145, 120);\">\'searchby\'</span>] == <span style=\"color: rgb(206, 145, 120);\">\'sender\'</span>){</p><p>                <span style=\"color: rgb(156, 220, 254);\">$load</span> = <span style=\"color: rgb(78, 201, 176);\">Emails</span>::<span style=\"color: rgb(220, 220, 170);\">where</span>(<span style=\"color: rgb(206, 145, 120);\">\'from\'</span>,<span style=\"color: rgb(206, 145, 120);\">\'LIKE\'</span>, <span style=\"color: rgb(206, 145, 120);\">\'%\'</span>.<span style=\"color: rgb(156, 220, 254);\">$data</span>[<span style=\"color: rgb(206, 145, 120);\">\'searchstring\'</span>].<span style=\"color: rgb(206, 145, 120);\">\'%\'</span>)</p><p>                -&gt;<span style=\"color: rgb(220, 220, 170);\">get</span>();</p><p>            }<span style=\"color: rgb(197, 134, 192);\">else</span> <span style=\"color: rgb(197, 134, 192);\">if</span>(<span style=\"color: rgb(156, 220, 254);\">$data</span>[<span style=\"color: rgb(206, 145, 120);\">\'searchby\'</span>] == <span style=\"color: rgb(206, 145, 120);\">\'recepient\'</span>){</p><p>                <span style=\"color: rgb(156, 220, 254);\">$load</span> = <span style=\"color: rgb(78, 201, 176);\">Emails</span>::<span style=\"color: rgb(220, 220, 170);\">where</span>(<span style=\"color: rgb(206, 145, 120);\">\'to\'</span>,<span style=\"color: rgb(206, 145, 120);\">\'LIKE\'</span>, <span style=\"color: rgb(206, 145, 120);\">\'%\'</span>.<span style=\"color: rgb(156, 220, 254);\">$data</span>[<span style=\"color: rgb(206, 145, 120);\">\'searchstring\'</span>].<span style=\"color: rgb(206, 145, 120);\">\'%\'</span>)</p><p>                -&gt;<span style=\"color: rgb(220, 220, 170);\">get</span>();</p><p>            }<span style=\"color: rgb(197, 134, 192);\">else</span> <span style=\"color: rgb(197, 134, 192);\">if</span>(<span style=\"color: rgb(156, 220, 254);\">$data</span>[<span style=\"color: rgb(206, 145, 120);\">\'searchby\'</span>] == <span style=\"color: rgb(206, 145, 120);\">\'subject\'</span>){</p><p>                <span style=\"color: rgb(156, 220, 254);\">$load</span> = <span style=\"color: rgb(78, 201, 176);\">Emails</span>::<span style=\"color: rgb(220, 220, 170);\">where</span>(<span style=\"color: rgb(206, 145, 120);\">\'subject\'</span>,<span style=\"color: rgb(206, 145, 120);\">\'LIKE\'</span>, <span style=\"color: rgb(206, 145, 120);\">\'%\'</span>.<span style=\"color: rgb(156, 220, 254);\">$data</span>[<span style=\"color: rgb(206, 145, 120);\">\'searchstring\'</span>].<span style=\"color: rgb(206, 145, 120);\">\'%\'</span>)</p><p>                -&gt;<span style=\"color: rgb(220, 220, 170);\">get</span>();</p><p>            }</p><p>            <span style=\"color: rgb(197, 134, 192);\">if</span>(<span style=\"color: rgb(156, 220, 254);\">$load</span>) {</p><p>                <span style=\"color: rgb(197, 134, 192);\">return</span> <span style=\"color: rgb(220, 220, 170);\">response</span>()-&gt;<span style=\"color: rgb(220, 220, 170);\">json</span>([<